import './custom-button.styles.scss';

const CustomButton = ({children,isGoogleSignIn , ...otherProps}) => (
  <button className={`${inverted ? 'inverted' : ''} ${isGoogleSignIn ? 'google-sign-in' : ''} custom-button`}   {...otherProps}>
